void chu()
{
	int i=k1[0],t=0;
	while(i)
	{
		t=t*10+k1[i];
		k1[i]=t/2;
		t%=2,i--;
	}
	while(k1[0]&&(!k1[k1[0]]))k1[0]--;
}

bool shs()
{
	for(j1=0;j1<=cs[0];j1++)k1[j1]=cs[j1];
	j1=1;
	while(j1<=j)
	{
		if(k1[1]%2!=cs[j1])return false;
		chu();j1++;
	}
	return true;
}

void work()
{
	m=0,j=1,m1=m;
	list[0][0]=1;
	do
	{
		for(i=0;i<=m1&&m<n;i++)
		{
//			if(i>1&&i<(m1/2-1))continue;
			cs[0]=j;//t=1;
			for(k=1;k<j;k++)
			{
				cs[k]=list[i][k];
//				if(cs[k])t++;
			}
			cs[j]=1;
//			if(t>((j+1)/2+1))continue;
			if(shs())
			{
				m++;
				list[m][0]=j;
				for(k=1;k<=j;k++)
					list[m][k]=cs[k];
				//for(k=list[m][0];k;k--)printf("%d",list[m][k]);
				//	printf("\n");
			}
		}
		j++,m1=m;
	}while(m<n);		
	for(i=list[n][0];i;i--)printf("%d",list[n][i]);
		printf("\n");
}

int main()
{
	freopen("number.in","r",stdin);
	freopen("number.out","w",stdout);
	scanf("%d",&n);
	if(n<=4200)
	{
		work();
	}
	else
	{
		n-=4201;
		for(i=0;ans[n][i];i++)
			if(ans[n][i]>=1)printf("1");
			else for(ans[n][i]*=-1,j=1;j<=ans[n][i];j++)printf("0");
		printf("\n");
//		work();
	}
	return 0;
}
